        function yousaywhat() {

        function setup() {
            frameRate(30);
            createCanvas(windowWidth, windowHeight);
            document.getElementById('defaultCanvas0').focus();
            if (isFullScreen) {
                fullscreen(isFullScreen);
            }
        }

        function draw() {
            if (switched) {
                ndraw();
                return;
            }
            if (!switched && !aborted && postCode && curPostCodePoint == postCode.length) {
                switched = true;
                yousaywhat();
                nsetup();
                textWidthMemo = {};
                return;
            }
            if (pStageFin) {
                if (aborted) {
                    let frac = Math.min(afCnt / 150, 1);
                    let k = Math.floor(Math.log2(Math.max(width, height) + 1) * frac + 1) * 3;
                    for (let i = 0; i < k; ++i) {
                        x = 1 / 2 + (Math.random() * frac - frac / 2);
                        y = 1 / 2 + (Math.random() * frac - frac / 2);
                        fill(255 * x, 255 * y, 255 * cos(x + y));
                        noStroke();
                        let mnr = Math.max(Math.max(width, height) / 30, 1);
                        let mxr = Math.max(Math.max(width, height) / 8, 1);
                        let r = Math.random() * max(mnr, mxr - mxr * afCnt / 450);
                        ellipse(x * width, y * height, r, r);
                    }
                    afCnt += 1;
                }
                return;

        function windowResized() {

                afCnt = 0;
                drawConsole();
            }

        function mousePressed() {
            if (switched) {
                return;
            }
            isFullScreen = !isFullScreen;
            fullscreen(isFullScreen);
        }

        function keyPressed() {
            if (switched) {
                nkeyPressed();
                return;
            }
            if (!input) {
                if (curCodePoint > 0 && curCodePoint < code.length && (key == 'c' || key == 'C') && keyIsDown(CONTROL)) {
                    code = code.slice(0, curCodePoint + curNonsensePoint);
                    postCode = '\n  .  .  .  \nCANCELLED. SYSTEM FAILURE. ABORT  .  .  .  ';
                    aborted = true;
                    return;
                }
                return;
            }
            if (keyCode == BACKSPACE) {
                curText = curText.slice(0, -1);
                return;
            }
            if (key.match('^[a-zA-Z0-9 ]$')) {
                curText += key;
                return;
            }
            if (keyCode == ENTER) {
                input = false;
                curPreCodePoint = 0;
                curCodePoint = 0;
                curPostCodePoint = 0;
                curNonsensePoint = 0;
                decodeBytes(bytes, curText);
                code = bytesToText(bytes);
                bytes = undefined;
                let bad = false;
                for (let i = 0; i < br.length; ++i) {
                    if (code[br[i]] != '}') {
                        bad = true;
                        break;
                    }
                }
                decodeBytes(bytesp, curText);
                if (bad) {
                    code = bytesToText(bytesp);
                    bad = false;
                    for (let i = 0; i < brp.length; ++i) {
                        if (code[brp[i]] != '}') {
                            bad = true;
                            break;
                        }
                    }
                }
                bytesp = undefined;
                preCode = '\nINITIALIZING DECODE SEQUENCE  .  .  .  \n';
                if (!bad) {
                    postCode = '\n  .  .  .  \nSUCCESS!\nSTARTING THE APPLICATION  .  .  .  ';

                    aborted = true;
                    postCode = '\n  .  .  .  \nYOU ENTERED WRONG KEY, HUMAN. SYSTEM FAILURE. ABORT  .  .  .  ';

                    let parts = [];
                    let cur = '';
                    for (let i = 0; i < code.length; ++i) {
                        if (Math.random() * 30 < 1) {
                            parts.push(cur);
                            cur = '';
                        }
                        cur += code[i];
                    }
                    parts.push(cur);
                    code = parts.join('\n');
                }
                return;
            }
        }

        function drawConsole() {
            background(45);
            drawConsoleStartText();

        function drawConsoleStartText() {
            let p = drawText('someone@somewhere', color(106, 204, 203), [10, 10 + yoffset]);

            p = drawText(' decode -key ', color(200), p);
            p = drawText(curText, color(200), p);
            if (!input) {
                if (curPreCodePoint < preCode.length) {
                    if (frameCount % MAGIC == 0) {
                        curPreCodePoint += 1;
                    }
                } else if (curCodePoint < code.length) {
                    if (curNonsensePoint < 150) {
                        curNonsensePoint += Math.floor(Math.random() * 12) + 12;
                    }
                    if (curCodePoint || curNonsensePoint >= 150) {
                        curCodePoint += Math.floor(Math.random() * 12) + 12;
                    }
                    curNonsensePoint = Math.min(curNonsensePoint, code.length - curCodePoint);
                } else if (curPostCodePoint < postCode.length) {
                    if (frameCount % MAGIC == 0) {
                        curPostCodePoint += 1;
                    }
                } else {
                    pStageFin = true;
                }

                p = drawText(preCode.slice(0, curPreCodePoint), color(240, 120, 124), p);
                p = drawText(code.slice(0, curCodePoint), color(0, 200, 0), p);
                let nonsense = '';
                for (let i = 0; i < curNonsensePoint; ++i) {
                    if (code.charAt(curCodePoint + i).match('[ \n\t\r]')) {
                        nonsense += code.charAt(curCodePoint + i);
                    } else {
                        nonsense += String.fromCharCode(Math.floor(32 + Math.random() * 224));
                    }
                }
                p = drawText(nonsense, color(0, 200, 0), p, false);
                p = drawText(postCode.slice(0, curPostCodePoint), color(240, 120, 124), p);

            if (frameCount % 30 < 15) {
                noStroke();
                fill(204);
                rectMode(CORNER);
                rect(p[0], p[1] - 2, getTextWidth('1', true), 18);

            while (p[1] >= height - 23) {
                yoffset -= 18;
                p[1] -= 18;
            }
        }

        function drawText(t, c, p, useMemo = true) {
            textSize(16);
            textAlign(LEFT, TOP);
            fill(c);
            noStroke();
            let acc = '';
            let np = p.slice();
            let calls = 0;
            for (let i = 0; i < t.length; ++i) {
                let ch = t.charAt(i);
                if (ch == '\n' || np[0] + getTextWidth(acc + ch, useMemo) > width - 10) {
                    calls += 1;
                    if (np[1] >= 10) {
                        text(acc, np[0], np[1]);
                    }
                    np[0] = 10;
                    np[1] += 18;
                    acc = '';
                    if (ch != '\n') {
                        acc += ch;
                    }
                } else {
                    acc += ch;
                }
            }
            if (acc) {
                if (np[1] >= 10) {
                    text(acc, np[0], np[1]);
                }
                np[0] += getTextWidth(acc, useMemo);
            }
            return np;
        }

        let textWidthMemo = {};

        function getTextWidth(t, u) {
            if (!u) {
                return textWidth(t);
            }
            if (!(t in textWidthMemo)) {
                textWidthMemo[t] = textWidth(t);
            }
            return textWidthMemo[t];
        }

        function bytesToText(b) {
            for (let i = 0; i < b.length; ++i) {
                if (b[i] >= 32 || String.fromCharCode(b[i]).match('[ \n\t\r]')) {
                    b[i] = String.fromCharCode(b[i]);
                } else {
                    b[i] = '?';
                }
            }
            let res = b.join('');
            return res;
        }

        function decodeBytes(b, key) {
            let rng = new Math.seedrandom(key);
            for (let i = 0; i < b.length; ++i) {
                b[i] = b[i] ^ Math.floor(rng() * 256);
            }
        }
